  //---------------
  useEffect(() => {
    getUsers();
  }, []);

  //---------------
  // HANDLE
  //---------------
  const getUsers = async () => {
    try {
      const resp = await axios("https://maqe.github.io/json/authors.json");
    } catch (err) {
      Swal.fire({
        title: "Error Fetching Data",
      });
    }
  };
  //---------------
  // RENDER
  //---------------
  return (
    <div className="">
      <div></div>
    </div>
  );
}

export default App;
